import numpy as np
import unittest

from porepy.grids import structured, simplex
from porepy.params import tensor
from porepy.numerics.vem import dual
import porepy.utils.comp_geom as cg

#------------------------------------------------------------------------------#

class BasicsTest( unittest.TestCase ):

#------------------------------------------------------------------------------#

    def test_dual_vem_1d_iso(self):
        g = structured.CartGrid(3, 1)
        g.compute_geometry()

        kxx = np.ones(g.num_cells)
        perm = tensor.SecondOrder(g.dim, kxx)

        solver = dual.DualVEM()
        M = solver.matrix(g, {'perm': perm}).todense()

        M_known = 1e-2 * np.array( [[ 25, -(8+1/3.), 0, 0, 1e2, 0, 0],
                                    [ -(8+1/3.), 50, -(8+1/3.), 0, -1e2, 1e2, 0],
                                    [ 0, -(8+1/3.), 50, -(8+1/3.), 0, -1e2, 1e2],
                                    [ 0, 0, -(8+1/3.), 25, 0, 0, -1e2],
                                    [ 1e2, -1e2,  0, 0, 0, 0, 0],
                                    [ 0, 1e2, -1e2, 0, 0, 0, 0],
                                    [ 0, 0, 1e2, -1e2, 0, 0, 0]] )

        rtol = 1e-15
        atol = rtol
        assert np.allclose(M, M.T, rtol, atol)
        assert np.allclose(M, M_known, rtol, atol)

